import React, { Component } from 'react';
import Phaser from 'phaser';
import { IonPhaser } from '@ion-phaser/react';
// import { initialState } from './Utilities/gameState';

const initialState = {
    initialize: true,
    game: {
        width: "100%",
        height: "100%",
        type: Phaser.AUTO,
        scale: {
            scaleMode: Phaser.Scale.RESIZE,
            mode: Phaser.Scale.FIT,
        },
        render: {
            antialias: true,
            pixelart: true,
            roundPixels: true
        },
        physics: {
            default: "arcade",
            arcade: {
                gravity: { y: 400 },
                debug: true
            }
        },
        scene:[
            null
        ],
    }
}


function Main (props) {
    // Sets Game state and Tells IonPhaser to initialize an instance of Phaser
    const { game, initialize } = initialState;

    console.log(`IN GAME::MAIN, Props :->`, props)

    return(

        <div>
            <IonPhaser game={game} initialize={initialize} />
        </div>
    )
}

export default Main
